import Logo from './Logo'
import PopulationChart from './PopulationChart'
import Footer from './Footer'
import React, { Component } from 'react';

class Home extends Component {
	render() {
  return (
    <div>
    	<a><h2 className = "welc"> Welcome to </h2></a>
    	<a><Logo /></a>
      	<PopulationChart />
      	<Footer />
    </div>
  );
}
}

export default Home;
